import React from 'react';
import { Link } from 'react-router-dom';

const ReportScreen = () => {
    return ( 
        <div className="w3-container w3-light-gray" style={{width: '100%',marginBottom: '10em',padding:0,fontSize: '1.2em'}}>
          <div className="">
            <div className="w3-margin-top w3-margin-left"><Link to="/dashboard"><i className="material-icons">arrow_back</i></Link></div>
          <div className=" w3-container ">
            <p className="">
                <h1>Harikrishna's</h1>
                <h1><b>Physical Report</b></h1>
            </p>
          </div>
        </div>
        <div className="w3-container w3-white" style={{ padding: 0,borderRadius: '25px 25px 0 0'}}>
        <div className="w3-container w3-margin-top">
          <span style={{ marginBottom: '0', paddingBottom: '10px', borderBottom: '1px solid lightgrey' }}>
            <b>Areas of strength</b>
          </span>
        </div>
        </div>
        </div>
     );
}

export default ReportScreen;
